import(chrome.runtime.getURL("/lib/monkey-script.js")).then(async (Monkey) => {
  const now = new Date();
  if (!now.toISOString().startsWith("2022-04-01")) return;

  const url = "https://www.youtube.com/watch?v=dQw4w9WgXcQ";
  const title = "Detacheringsbureau InWork neemt concurrent Randstad over";
  const content =
    "Detacheringsbureau InWork, bekend van de merkbelofte 'Duurzaam Werkgeluk' neemt concurrent Randstad over.";
  const img64 =
    "data:image/png;base64,";

  if (window.location.href === "https://nos.nl/") {
    const ul = await Monkey.waitForSelector(
      "#content > div > div > section > ul"
    );

    ul.insertAdjacentHTML("afterbegin", ul.firstElementChild.outerHTML);
    const li = ul.firstElementChild;

    li.querySelector("a").href = url;
    li.querySelector("h2").textContent = title;
    li.querySelector("p").textContent = content;

    const img = li.querySelector("img");
    img.src = img64;
    img.srcset = "";

    const pill = img.parentElement.nextElementSibling;
    if (pill) {
      pill.parentElement.removeChild(pill);
    }

    const ul2 = await Monkey.waitForSelector("aside > div > div > ul");
    ul2.insertAdjacentHTML("afterbegin", ul2.firstElementChild.outerHTML);
    const li2 = ul2.firstElementChild;

    li2.querySelector("a").href = url;
    li2.querySelector("a > span").textContent = title;
    li2.querySelector(
      "time"
    ).textContent = `${now.getHours()}:${now.getMinutes()}`;

    const liveblogish = li2.querySelector("a > div > span");
    if (liveblogish) liveblogish.parentElement.removeChild(liveblogish);
  } else if (window.location.href === "https://www.nu.nl/") {
    const ul = await Monkey.waitForSelector("#main .column.first ul");

    ul.insertAdjacentHTML("afterbegin", ul.firstElementChild.outerHTML);
    ul.firstElementChild.querySelector("a").href = url;
    const span = ul.firstElementChild.querySelector(".item-title span");
    span.textContent = span.title = title;

    const ul2 = await Monkey.waitForSelector("aside ul.list--timestamp");
    ul2.insertAdjacentHTML("afterbegin", ul2.firstElementChild.outerHTML);
    ul2.firstElementChild.querySelector("a").href = url;
    const span2 = ul2.firstElementChild.querySelector(".item-title span");
    span2.textContent = span.title = title;
    ul2.firstElementChild.querySelector(
      "time"
    ).textContent = `${now.getHours()}:${now.getMinutes()}`;
  } else if (window.location.href === "https://inwork.nl/") {
    const row = await Monkey.waitForSelector("div.blog-items .row");
    const div = row.lastElementChild;
    row.firstElementChild.after(div);
    div.querySelector("img").src = img64;
    div.querySelector("h2").textContent = title;
    div.querySelector("span.me-2").textContent = "1 april 2022";
    div.querySelector("a").href = url;
  }
});
